import React from 'react'
// import { Link } from 'react-router-dom'

export default function NewContact() {
    state ={
        name:"",
        lastName:"",
        email:"",
        birthDate: undefined,
        phone:"",
    }



     function handleEmailChange(e) {
      this.setState({email: e.target.value});
     }

    render()
        { return (
        <form className = "NewContactForm">
            <input className = "NameInput" name = "Nombre"></input>
            <input className = "LastNameInput" name = "Apellido"></input>
            <input className = "EmailInput" type = "email" name = "Email" value={this.state.email} onChange={this.handleEmailChange()}></input>
            <input className = "BirthDateInput" type = "date" name= "Fecha de nacimiento"></input>
            <input className = "PhoneInput" name = "Numero de telefono"></input>
        </form>
    )
        }

}
